// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@chainlink/contracts/src/v0.8/VRFConsumerBaseV2.sol";
import "@chainlink/contracts/src/v0.8/interfaces/VRFCoordinatorV2Interface.sol";

/**
 * @title MultiRaffle
 * @notice Single-winner raffle logic with a dynamic array of sold ticketNumbers.
 */
contract MultiRaffle is
    ERC721Enumerable,
    Ownable,
    ReentrancyGuard,
    VRFConsumerBaseV2
{
    // =========================================================
    // STRUCTS
    // =========================================================

    /**
     * @dev `RaffleSettings` for a single-winner raffle:
     *   - ticketSize: cost per ticket (wei)
     *   - numberRange: valid ticketNumbers in [1..numberRange]
     *   - houseTake: 0..100 (percentage)
     *   - raffleDuration: how long until raffleDeadline, in seconds
     */
    struct RaffleSettings {
        uint256 ticketSize;
        uint256 numberRange;
        uint256 houseTake;      
        uint256 raffleDuration; 
    }

    /**
     * @dev Stores all data about a single raffle.
     *      `winnerPicked` becomes true once Chainlink picks the winner.
     */
    struct RaffleData {
        // Metadata
        string raffleName;
        string raffleImage;
        string raffleDescription;

        // Settings
        uint256 ticketSize;
        uint256 numberRange;
        uint256 houseTake;
        uint256 raffleDeadline;

        // State
        uint256 treasuryBalance;   
        uint256 remainingPrizePool;
        bool raffleEnded;
        uint256 lastDrawTime;
        uint256 ticketsSoldCount;

        // Winner info
        bool winnerPicked;
        uint256 winningTicketNumber;
        address winnerAddress;
    }

    /**
     * @dev For each minted NFT ticket, store which raffle & ticketNumber.
     */
    struct RaffleTicket {
        uint256 raffleId;
        uint256 ticketNumber;
    }

    // =========================================================
    // STORAGE
    // =========================================================

    RaffleData[] public raffles;

    /**
     * @notice For each raffle, store a dynamic array of sold ticketNumbers.
     *         e.g. soldTickets[raffleId] = [7, 42, 99, ...]
     */
    mapping(uint256 => uint256[]) public soldTickets;

    /**
     * @notice raffleId => (ticketNumber => tokenId).
     *         0 means unsold.
     */
    mapping(uint256 => mapping(uint256 => uint256)) public raffleTicketId;

    /**
     * @notice tokenId => RaffleTicket info (which raffle, which ticketNumber).
     */
    mapping(uint256 => RaffleTicket) public raffleTicketInfo;

    /// @dev global token ID for minted tickets
    uint256 public nextTokenId;

    /// @dev The house address that receives treasuryBalance
    address public houseAccount;

    // ---------------------------------------------------------
    // Chainlink VRF config
    // ---------------------------------------------------------
    VRFCoordinatorV2Interface public COORDINATOR;
    uint64  public subscriptionId;
    bytes32 public keyHash;
    uint32  public callbackGasLimit     = 100000;
    uint16  public requestConfirmations = 3;
    uint32  public numWords             = 1;

    /// @dev requestId => raffleId
    mapping(uint256 => uint256) public requestIdToRaffleId;

    // =========================================================
    // EVENTS
    // =========================================================
    event RaffleCreated(uint256 indexed raffleId, string name);
    event TicketPurchased(uint256 indexed raffleId, address indexed buyer, uint256 ticketNumber, uint256 tokenId);
    event RaffleEnded(uint256 indexed raffleId);
    event WinnerSelected(uint256 indexed raffleId, uint256 winningTicket, address winner, uint256 prize);

    // =========================================================
    // CONSTRUCTOR
    // =========================================================
    constructor(
        address _owner,
        address _houseAccount,
        address vrfCoordinator,
        uint64  _subscriptionId,
        bytes32 _keyHash
    )
        ERC721("MultiRaffleTicket", "MRFT")
        VRFConsumerBaseV2(vrfCoordinator)
    {
        require(_houseAccount != address(0), "Invalid houseAccount");
        houseAccount   = _houseAccount;
        COORDINATOR    = VRFCoordinatorV2Interface(vrfCoordinator);
        subscriptionId = _subscriptionId;
        keyHash        = _keyHash;

        _transferOwnership(_owner);
    }

    /// @notice The factory address that can create new raffles
    address public factory;

    function setFactory(address _factory) external onlyOwner {
        require(_factory != address(0), "Invalid factory");
        factory = _factory;
    }

    modifier onlyFactory() {
        require(msg.sender == factory, "Only factory");
        _;
    }

    // =========================================================
    // CREATE RAFFLE
    // =========================================================

    /**
     * @notice Create a new single-winner raffle, returning its ID.
     */
    function createRaffle(
        RaffleSettings memory _settings,
        string memory _raffleName,
        string memory _raffleImage,
        string memory _raffleDescription
    )
        external
        onlyFactory
        returns (uint256 raffleId)
    {
        raffleId = _createRaffle(_settings, _raffleName, _raffleImage, _raffleDescription);
    }

    function _createRaffle(
        RaffleSettings memory s,
        string memory _name,
        string memory _img,
        string memory _desc
    )
        internal
        returns (uint256)
    {
        require(s.houseTake <= 100, "House cut > 100%");
        require(s.ticketSize > 0, "ticketPrize=0");
        require(s.numberRange > 0, "numberRange=0");

        RaffleData memory r;
        r.raffleName        = _name;
        r.raffleImage       = _img;
        r.raffleDescription = _desc;
        r.ticketSize       = s.ticketSize;
        r.numberRange       = s.numberRange;
        r.houseTake         = s.houseTake;
        r.raffleDeadline    = block.timestamp + s.raffleDuration;
        r.lastDrawTime      = block.timestamp;

        raffles.push(r);
        uint256 newId = raffles.length - 1;
        emit RaffleCreated(newId, _name);
        return newId;
    }

    // =========================================================
    // BUY TICKET
    // =========================================================

    function buyTicket(uint256 raffleId, uint256 ticketNumber)
        external
        payable
        nonReentrant
    {
        RaffleData storage r = raffles[raffleId];

        require(!r.raffleEnded, "Already ended");
        require(block.timestamp <= r.raffleDeadline, "Deadline passed");

        require(ticketNumber >= 1 && ticketNumber <= r.numberRange, "ticketNumber out of range");
        require(msg.value == r.ticketSize, "Wrong ETH amount");
        require(raffleTicketId[raffleId][ticketNumber] == 0, "Ticket sold");

        // House cut vs. prize
        uint256 houseCut = (msg.value * r.houseTake) / 100;
        uint256 prize    = msg.value - houseCut;

        r.treasuryBalance    += houseCut;
        r.remainingPrizePool += prize;
        r.ticketsSoldCount   += 1;

        nextTokenId++;
        uint256 tokenId = nextTokenId;
        _safeMint(msg.sender, tokenId);

        raffleTicketId[raffleId][ticketNumber] = tokenId;
        raffleTicketInfo[tokenId] = RaffleTicket(raffleId, ticketNumber);

        // Save the sold ticketNumber in dynamic array
        soldTickets[raffleId].push(ticketNumber);

        emit TicketPurchased(raffleId, msg.sender, ticketNumber, tokenId);
    }

    // =========================================================
    // RANDOM PICK OF WINNER (CHAINLINK VRF)
    // =========================================================

    /**
     * @notice Called by the owner once the raffle is past its deadline.
     */
    function requestRandomNumber(uint256 raffleId) external onlyOwner {
        RaffleData storage r = raffles[raffleId];

        require(!r.raffleEnded, "Already ended");
        require(block.timestamp > r.raffleDeadline, "Not past deadline");
        require(r.ticketsSoldCount > 0, "No tickets sold");

        r.raffleEnded = true;
        emit RaffleEnded(raffleId);

        uint256 reqId = COORDINATOR.requestRandomWords(
            keyHash,
            subscriptionId,
            requestConfirmations,
            callbackGasLimit,
            numWords
        );
        requestIdToRaffleId[reqId] = raffleId;
    }

    function fulfillRandomWords(uint256 requestId, uint256[] memory randomWords) internal override {
        uint256 raffleId = requestIdToRaffleId[requestId];
        RaffleData storage r = raffles[raffleId];
        if (r.winnerPicked) return;
        if (r.ticketsSoldCount == 0) return; // just in case

        // 1) pick random index in [0..(soldTickets[raffleId].length - 1)]
        uint256 totalSold = soldTickets[raffleId].length;
        uint256 randomIndex = randomWords[0] % totalSold;

        // 2) retrieve the actual ticketNumber from the array
        uint256 winningTicketNumber = soldTickets[raffleId][randomIndex];

        // 3) get the NFT ticket's owner
        uint256 tokenId = raffleTicketId[raffleId][winningTicketNumber];
        address winner = ownerOf(tokenId);

        // 4) transfer the entire prize to the winner
        uint256 prize = r.remainingPrizePool;
        if (prize > 0) {
            r.remainingPrizePool = 0;
            (bool ok, ) = payable(winner).call{value: prize}("");
            require(ok, "Prize transfer failed");
        }

        // 5) record the winner
        r.winnerPicked         = true;
        r.winningTicketNumber  = winningTicketNumber;
        r.winnerAddress        = winner;

        emit WinnerSelected(raffleId, winningTicketNumber, winner, prize);
    }

    // =========================================================
    // VIEW RAFFLE
    // =========================================================

    /**
     * @notice Return data about a raffle, including if winner was picked, etc.
     */
    function getRaffleData(uint256 raffleId)
        external
        view
        returns (
            string memory nameOfRaffle,
            string memory raffleImg,
            string memory raffleDesc,
            uint256 ticketsSold,
            uint256 currentPrize,
            uint256 timeLeft,
            bool ended,
            bool winnerPicked,
            uint256 winningTicketNumber,
            address winner
        )
    {
        RaffleData storage r = raffles[raffleId];

        nameOfRaffle = r.raffleName;
        raffleImg    = r.raffleImage;
        raffleDesc   = r.raffleDescription;

        ticketsSold = r.ticketsSoldCount;
        currentPrize = r.remainingPrizePool;

        if (block.timestamp >= r.raffleDeadline) {
            timeLeft = 0;
        } else {
            timeLeft = r.raffleDeadline - block.timestamp;
        }

        ended               = r.raffleEnded;
        winnerPicked        = r.winnerPicked;
        winningTicketNumber = r.winningTicketNumber;
        winner              = r.winnerAddress;
    }

    function getRafflesLength() external view returns (uint256) {
        return raffles.length;
    }

    // =========================================================
    // WITHDRAW & ADMIN
    // =========================================================

    /**
     * @notice Withdraw the house's cut for a raffle.  
     */
    function withdrawHouseBalance(uint256 raffleId) external nonReentrant {
        RaffleData storage r = raffles[raffleId];
        require(msg.sender == houseAccount || msg.sender == owner(), "Not house or owner");

        uint256 amount = r.treasuryBalance;
        require(amount > 0, "No house balance");

        r.treasuryBalance = 0;
        (bool ok, ) = payable(houseAccount).call{value: amount}("");
        require(ok, "Withdraw failed");
    }

    function updateHouseAccount(address newHouseAccount) external onlyOwner {
        require(newHouseAccount != address(0), "Invalid address");
        houseAccount = newHouseAccount;
    }

    function updateVRFConfig(
        uint64  _subscriptionId,
        bytes32 _keyHash,
        uint32  _callbackGasLimit,
        uint16  _requestConfirmations,
        uint32  _numWords
    ) external onlyOwner {
        subscriptionId       = _subscriptionId;
        keyHash              = _keyHash;
        callbackGasLimit     = _callbackGasLimit;
        requestConfirmations = _requestConfirmations;
        numWords             = _numWords;
    }

    receive() external payable {}

    function withdrawStuckETH() external onlyOwner nonReentrant {
        uint256 bal = address(this).balance;
        require(bal > 0, "No ETH to withdraw");
        (bool success, ) = payable(owner()).call{ value: bal }("");
        require(success, "Transfer failed");
    }
}
